import React, { Fragment } from "react";

const ListTodos = () => {
    return (
        <Fragment>
            <table class="table">
                <thead>
                    <tr>
                        <th>Firstname</th>
                        <th>Lastname</th>
                        <th>Email</th>
                    </tr>
                </thead>
            </table>
        </Fragment>
    );
}

export default ListTodos;
